/**
 * 특정 연도와 절기명으로 절기 데이터 조회
 */
export function getSolarTerm2101_2200(year: number, term: SolarTerm): SolarTermComplete | undefined {
  return SOLAR_TERMS_2101_2200.find(st => st.year === year && st.term === term);
}

/**
 * 특정 연도의 모든 절기 데이터 조회
 */
export function getYearSolarTerms2101_2200(year: number): SolarTermComplete[] {
  return SOLAR_TERMS_2101_2200.filter(st => st.year === year);
}

/**
 * 특정 날짜의 현재 절기 조회
 */
export function getCurrentSolarTerm2101_2200(date: Date): SolarTermComplete | null {
  const timestamp = date.getTime();
  let currentTerm: SolarTermComplete | null = null;

  for (const term of SOLAR_TERMS_2101_2200) {
    if (term.timestamp <= timestamp) {
      currentTerm = term;
    } else {
      break;
    }
  }

  return currentTerm;
}

/**
 * 특정 날짜의 다음 절기 조회
 */
export function getNextSolarTerm2101_2200(date: Date): SolarTermComplete | null {
  const timestamp = date.getTime();

  for (const term of SOLAR_TERMS_2101_2200) {
    if (term.timestamp > timestamp) {
      return term;
    }
  }

  return null;
}
